Saint Morice (Šveicarija) vykusiose žaidynėse čiuožimo rungtyje jis užėmė 5-ą vietą. Maža to, atletas tapo žymiu tarpukario sporto veikėju, greitojo čiuožimo, ledo ritulio, futbolo, krepšinio ir kitų sporto šakų pradininku Lietuvoje. Multi-sporto atstovas Kaip sako istorikas  Algis Bitautas , K. Bulotą galima drąsiai vadinti multi-sporto atstovu. Jis dalyvavo pirmose Lietuvos futbolo pirmenybėse ir du kartus tapo šalies čempionu, atletas sužaidė ir pirmose Lietuvos krepšinio varžybose, pirmose Lietuvos ledo ritulio rungtynėse, du kartus tapo Lietuvos sportinio ėjimo rekordininku, penkis kartus tapo šalies čiuožimo čempionu. „K. Bulota Saint Morice varžėsi keturiose rungtyse. Aukščiausią – penktąją – vietą jis užėmė 10 000 m čiuožimo rungtyje. Įdomu tai, kad šios varžybos buvo nutrauktos dėl Šveicarijos oro sąlygų. Nuo šilumos ir drėgmės ledas pažliugo ir dalis čiuožėjų negalėjo startuoti. Bet K. Bulota buvo tarp tų sportininkų, kurie baigė distanciją, todėl ir turime užfiksuotą jo laiką. Kitose rungtyse jis liko 25-oje ir 28-oje vietose“, – pasakoja A. Bitautas. Olimpietis kartu su S. Dariumi daug nuveikė ir vystydami sporto infrastruktūrą. Iš Kauno valdžios jie išsinuomojo teritoriją Ąžuolyno parke, kurioje vėliau suprojektavo futbolo stadioną su bėgimo takeliais. Tai dabartinis S. Dariaus ir S. Girėno lengvosios atletikos ir futbolo stadionas Kaune, talpinantis daugiau nei 9 tūkst. žiūrovų. Deja, žymų sportininką ir tikrą Lietuvos patriotą ištiko tragiškas likimas: 1941 m. birželio 14 d., Sovietų Sąjungai vykdant masinį lietuvių trėmimą, jis išvežtas į Sibirą. Ten sportininkas neprarado noro kovoti ir nusprendė bėgti iš lagerio, tačiau buvo pastebėtas pareigūnų ir nušautas. Pasak žurnalisto, laidų vedėjo ir sporto mėgėjo Marijono Mikutavičiaus, K. Bulotos istorija patvirtina, kad sportininkai yra pernelyg dažnai ir nepelnytai pamirštami. „Jeigu sportininkas nelaimi medalio, mums pasidaro nebeįdomu. Jei neparveži trofėjaus, vadinasi, per mažai dirbai, turi per mažai talento. Tačiau daugybė žmonių sportui atiduoda savo sveikatą, nors medalių taip ir nepelno. K. Bulota toks ir buvo. Prisipažinsiu, apie jį iki šiol nebuvau girdėjęs. Tik perskaitęs šio žmogaus gyvenimo istoriją supratau, kokios stiprios asmenybės tai būta, ir kiek daug jis prisidėjo prie šalies sporto raidos“, – teigia M. Mikutavičius. Ledo ritulio pradininkas Lietuvoje Pasak A. Bitauto, ko gero, daugiausiai įtakos K. Bulota turėjo ledo ritulio raidai. Sukritikavęs tuometinį Lietuvos ledo ritulio žaidimą, kuriame buvo naudojamas kamuolys ir žaidžiama ne pagal galiojusias taisykles, jis pradėjo iniciatyvą, kuria raginta ir Lietuvoje pereiti prie kanadietiškų žaidimo taisyklių. Įvykus šioms permainoms pagaliau buvo surengtos ir pirmosios tarpvalstybinės rungtynės su Latvija, kurias Lietuva pralaimėjo rezultatu 0-3. Nepaisant to, ši sporto šaka Lietuvoje ėmė sparčiai populiarėti, o jos lygis kilti. 1938 m. Lietuvos ledo rinktinė dalyvavo pasaulio ledo ritulio čempionate, kuriame užėmė 10 vietą. Šis pasiekimas iki pat šių dienų yra nepakartotas. „Ledo ritulio varžybas labai smagu žiūrėti. Šis žaidimas suteikia netgi daugiau nei krepšinis ar futbolas. Viskas čia labai intensyvu ir greita. Tai tikrai vyriškas sportas, kuris turėtų būti įdomus kiekvienam berniukui. Manau, jeigu turėtume stiprią ledo rutulio komandą, kuri dalyvautų žiemos olimpiadoje, visi sėdėtų prilipę prie televizijos ekranų“, – įsitikinęs M. Mikutavičius. (function(d, s, i, r) {
